import { FunctionComponent } from "react";
import StyleButtons from "./Css/Buttons.module.css";


type ButtonsType = {
  onClick? (): void;
  Text?: string | any;
  type?:string;

  IconEnd?: string;
  IconStart?: string;

  TextAlign?: string;
  ButtonColor?: string;
  TextColor?: string;
  BorderColor?: string;
  BorderRadiusValue?: number;
  MaxWidth?: string;
};

const Buttons: FunctionComponent<ButtonsType> = ({
  onClick,
  Text,
  type,
  IconEnd,
  IconStart,
  TextAlign,
  ButtonColor,
  TextColor,
  BorderColor,
  BorderRadiusValue,
  MaxWidth
}) => {

  let styleBotao;

  let Botao = document.getElementById("ButtonID");

  if(BorderRadiusValue != 0 && BorderRadiusValue != null){
    styleBotao = " border-radius: " + BorderRadiusValue + "px;";
  }else{
    styleBotao = StyleButtons.Button;
  }

  const styles = {
    Botao: {
      BorderRadius: 10
    }
  };

  return (
    <div id="ButtonID" className={StyleButtons.button} onClick={onClick}>
      <div className={StyleButtons.iconstart}>
        <img className={StyleButtons.vectorIcon} alt="" src={IconStart} />
      </div>
      <div className={StyleButtons.text}>{Text}</div>
      <div className={StyleButtons.iconend}>
        <img className={StyleButtons.vectorIcon} alt="" src={IconEnd} />
      </div>
    </div>
  );
};

export default Buttons;
